Step 1: The expression inside the square root must be non-negative, so we set up the inequality $$-10x^2-11x+6 \geq 0.$$
Step 2: 
\begin{align*}
-10x^2-11x+6&\geq 0\\
\Leftrightarrow\qquad 10x^2+11x-6&\leq 0\\
\Leftrightarrow\qquad (5x-2)(2x+3)&\leq 0
\end{align*}
Step 3:
\begin{align*}
(5x-2)(2x+3)&\leq 0\\
\Leftrightarrow\qquad 5x-2\leq 0\text{ and }2x+3\geq 0&\text{ or }5x-2\geq 0\text{ and }2x+3\leq 0\\
\Leftrightarrow\qquad x\leq \frac{2}{5}\text{ and }x\geq -\frac{3}{2}&\text{ or }x\geq \frac{2}{5}\text{ and }x\leq -\frac{3}{2}\\
\Leftrightarrow\qquad \left(-\frac{3}{2},\frac{2}{5}\right)&\text{ or }\text{no solution}
\end{align*}
The next step is:
Step 4:\begin{align*}
\left(-\frac{3}{2},\frac{2}{5}\right)&\text{ or }\text{no solution}\\
\Leftrightarrow\qquad -\frac{3}{2}\leq x\leq \frac{2}{5}&\text{ or }\text{no solution}
\end{align*}
Step 5: The domain is $\boxed{\left[-\frac{3}{2},\frac{2}{5}\right]}.$
